import { getMovies } from '../services/fakeMovieService';

class Movies extends Component {
  state = {
    movies: getMovies(),
  };

  render() {
    return (
      <main className="container">
        <table>
          <tr>
            <td>
              <strong>Title</strong>
            </td>
            <td>
              <strong>Genre</strong>
            </td>
            <td>
              <strong>Stock</strong>
            </td>
            <td>
              <strong>Rate</strong>
            </td>
            <td></td>
          </tr>
          <tr>
            <td>{this.state.movies.title}</td>
            <td></td>
            <td></td>
            <td></td>
            <td></td>
          </tr>
        </table>
      </main>
    );
  }
}

export default Movies;
